import React, { Component } from "react";
import Mnemonic from "../../../components/Post/Post";

export default class MnemonicRender extends Component {
    render() {
        const mnemonicIDs = ["Antibiotics", "Inotropics", "Fluid status", "ECG", "Acid-base status"];
        const { id } = this.props.match.params;
        return id && mnemonicIDs.includes(id) ? (
            <Post id={id} />
        ) : (
            <div>
                <h3>Error: Mnemonic #{id} NOT FOUND</h3>
            </div>
        );
    }
}
